import ProfileCard from './ProfileCard';
import AlexaImage from './images/alexa.png';
import CortanaImage from './images/cortana.png';
import SiriImage from './images/siri.png';

function App() {
  return (
    <div>
      <div>Personal Digital Assistants</div>

      <ProfileCard image={AlexaImage} title="alexa" handle="@alexa69" />
      <ProfileCard image={CortanaImage} title="Cotana" handle="@cuntyC" />
      <ProfileCard image={SiriImage} title="Siri" handle="@SuckySiri" />
    </div>
  );
}

export default App;
